    true,nt"url": null,nt"notes": "This report provides information regarding
    suicide mortality for the years 2001u20132014. It incorporates the most recent mortality
    data from the VA/Department of Defense (DoD) Joint Suicide Data Repository and includes
    information for deaths from suicide among all known Veterans of U.S. military service.
    Data for the Joint VA/DoD Suicide Data Repository were obtained from the National
    Center for Health Statisticsu2019 National Death Index through collaboration with
    the DoD, the CDC, and the VA/DoD Joint Suicide Data Repository initiative. Data
    available from the National Death Index include reports of mortality submitted from
    vital statistics systems in all 50 U.S. states, New York City, Washington D.C.,
    Puerto Rico, and the U.S. Virgin Islands.",nt"license_title": "Creative Commons
